import { 
    SET_TOKEN,
    SET_NEW_RELEASES
 } from './actionTypes';

export const setToken = (payload) => ({
    type: SET_TOKEN,
    payload
});
export const setNewReleases = (payload) => ({
    type: SET_NEW_RELEASES,
    payload
});
